import React from 'react';
import cube from './Images/Cube.png'
import Paper from '@mui/material/Paper';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { styled } from '@mui/material/styles';
import './Aegis.css'

const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
}));
const ColorButton = styled(Button)(({ theme }) => ({
    color: theme.palette.getContrastText(purple[500]),
    backgroundColor: purple[500],
    '&:hover': {
      backgroundColor: purple[700],
    },
  }));
function AegisMaster(){
    return(
        <div>
           <Stack spacing={2} direction="row"justifyContent="center"alignItems="center">
           <Card sx={{ minWidth: 275, backgroundColor: '#121212'}}>
           <CardContent>
           <Typography sx={{ fontSize: 34, textAlign: 'center', color: '#f6f7f6'}} color="text.secondary" gutterBottom>Basic</Typography>
           <Typography sx={{ fontSize: 20, textAlign: 'center', fontStyle: 'italic', color: '#f6f7f6'}} color="text.secondary" gutterBottom>$399/Yr</Typography>
           <Typography sx={{ fontSize: 14, textAlign: 'center', color: '#f6f7f6'}} color="text.secondary" gutterBottom>Supports 3 Cameras</Typography>
           <Typography sx={{ fontSize: 14, textAlign: 'center', color: '#f6f7f6'}} color="text.secondary" gutterBottom></Typography>
           </CardContent>
           </Card>
           <Card sx={{ minWidth: 275, backgroundColor: '#121212'}}>
           <CardContent>
           <Typography sx={{ fontSize: 34, textAlign: 'center', color: '#f6f7f6'}} color="text.secondary" gutterBottom>Upgrade</Typography>
           <Typography sx={{ fontSize: 20, textAlign: 'center', fontStyle: 'italic', color: '#f6f7f6'}} color="text.secondary" gutterBottom>$499/Yr</Typography>
           <Typography sx={{ fontSize: 14, textAlign: 'center', color: '#f6f7f6'}} color="text.secondary" gutterBottom>Supports 5 Cameras</Typography>
           <Typography sx={{ fontSize: 14, textAlign: 'center', color: '#f6f7f6'}} color="text.secondary" gutterBottom></Typography>
           </CardContent>
           </Card>
           <Card sx={{ minWidth: 275, backgroundColor: '#121212'}}>
           <CardContent>
           <Typography sx={{ fontSize: 34, textAlign: 'center', color: '#f6f7f6'}} color="text.secondary" gutterBottom>Large Building</Typography>
           <Typography sx={{ fontSize: 20, textAlign: 'center', fontStyle: 'italic', color: '#f6f7f6'}} color="text.secondary" gutterBottom>$699/Yr</Typography>
           <Typography sx={{ fontSize: 14, textAlign: 'center', color: '#f6f7f6'}} color="text.secondary" gutterBottom>Supports 8 Cameras</Typography>
           <Typography sx={{ fontSize: 14, textAlign: 'center', color: '#f6f7f6'}} color="text.secondary" gutterBottom></Typography>
           </CardContent>
           </Card>
           <Card sx={{ minWidth: 275, backgroundColor: '#121212'}}>
           <CardContent>
           <Typography sx={{ fontSize: 34, textAlign: 'center', color: '#f6f7f6'}} color="text.secondary" gutterBottom>Enterprise</Typography>
           <Typography sx={{ fontSize: 20, textAlign: 'center', fontStyle: 'italic', color: '#f6f7f6'}} color="text.secondary" gutterBottom>$999/Yr</Typography>
           <Typography sx={{ fontSize: 14, textAlign: 'center', color: '#f6f7f6'}} color="text.secondary" gutterBottom>Supports 15 Cameras</Typography>
           <Typography sx={{ fontSize: 14, textAlign: 'center', color: '#f6f7f6'}} color="text.secondary" gutterBottom></Typography>
           </CardContent>
           </Card>
           </Stack>
           <Stack spacing={2} direction="row" justifyContent="center" alignItems="center" padding="100px">
           <ColorButton variant="contained">Contact U</ColorButton>
           </Stack>
        </div>
    )
}
export default AegisMaster;
